export type I18NMessages = Omit<DefaultI18NMessages, keyof ValidOverrides> & ValidOverrides;

type ValidOverrides = {
    [Key in keyof OmitIndexSignature<I18NMessagesOverride> as I18NMessagesOverride[Key] extends FM | string
        ? Key
        : never
    ]: I18NMessagesOverride[Key];
};

/**
 * Augment this interface to override properties of {@link I18NMessages}.
 * @see https://typescriptlang.org/docs/handbook/declaration-merging#module-augmentation
 */
export interface I18NMessagesOverride extends Record<PropertyKey, FM | string> {}

